import React from 'react';
import Header from './components/Header';
import { Typography } from '@material-ui/core'
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Typography variant="h3">Pagina de teste 1</Typography>
      <Typography variant="subtitle1">Description</Typography>

    </div>
  );
}

export default App;
